import React, { Component } from 'react';
import './style/App.css';
import LoginPropmpt from './Components/loginPrompt.js';
import AppContents from './Components/appContents.js';

const { Provider, Consumer } = React.createContext({
  user: {},
  logout: "Test"
});

class App extends Component {

  constructor(props) {
    super(props)

    this.state = {
      user: {
        email: "",
        firstName: "",
        lastName: "",
        authed: false,
        authToken: null
      }
    }
  }

  logout() {
    console.log("Logging out...");
  }

  render() {

    return (

      <div className="App">
        <Provider value={this.props}>
          {(this.state.user.authed && this.state.user.authToken === null) ? <AppContents /> : <LoginPropmpt /> }
        </Provider>
      </div>
    );
  }
}

export default App;
